-- Minimal operational schema for Lab 2
CREATE TABLE customers (customer_id INT PRIMARY KEY, name TEXT, email TEXT, created_at TIMESTAMP);
CREATE TABLE brands (brand_id INT PRIMARY KEY, brand_name TEXT);
CREATE TABLE categories (category_id INT PRIMARY KEY, category_name TEXT);
CREATE TABLE products (product_id INT PRIMARY KEY, product_name TEXT, brand_id INT REFERENCES brands(brand_id), category_id INT REFERENCES categories(category_id), price NUMERIC(10,2));
CREATE TABLE orders (order_id INT PRIMARY KEY, customer_id INT REFERENCES customers(customer_id), order_date TIMESTAMP);
CREATE TABLE order_items (order_item_id INT PRIMARY KEY, order_id INT REFERENCES orders(order_id), product_id INT REFERENCES products(product_id), quantity INT, unit_price NUMERIC(10,2));
